import styled from 'styled-components';

export const HomeContainer = styled.div`
    width: 80%;
    margin: auto;

    .categories{
        display: flex;
        margin:20px;
    }

    .input-group{
        position: relative;
        top: -275px;
        left:35%;         
    }

    .joker{
        display: block;
    }

    .img img{
        width: 10px;
    }

`
